import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import BuildPizza from "./pages/BuildPizza";
import Login from "./pages/Login";
import Register from "./pages/Register";
import MyOrders from "./pages/MyOrders";
import AdminDashboard from "./pages/AdminDashboard";

export default function App() {
  return (
    <Router>
      <div>
        {/* Navbar */}
        <nav style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          padding: "10px 20px",
          backgroundColor: "#F37254",
          color: "white"
        }}>
          <h2>Pizzalicious</h2>
          <div>
            <Link to="/" style={{ color: "white", marginRight: "15px" }}>Home</Link>
            <Link to="/build-pizza" style={{ color: "white", marginRight: "15px" }}>Build Pizza</Link>
            <Link to="/my-orders" style={{ color: "white", marginRight: "15px" }}>My Orders</Link>
            <Link to="/login" style={{ color: "white" }}>Login</Link>
          </div>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<h1 style={{ textAlign: "center", marginTop: "50px" }}>Welcome to Pizzalicious üçï</h1>} />
          <Route path="/build-pizza" element={<BuildPizza />} />
          <Route path="/my-orders" element={<MyOrders />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/admin" element={<AdminDashboard />} />
        </Routes>
      </div>
    </Router>
  );
}
